De filmactrice Emily Moore wordt ontvoerd en gemarteld door een gemaskerde man. De pers ziet de man als een psychotische fan maar Emily is de enige die de werkelijke reden van de ontvoering weet. Op de vlucht voor de ellende die haar achtervolgt, ontvlucht Emily met haar man Robert, een psychiater, New York. Ze vertrekken naar een mediterraans eiland. Het idyllische paradijs verandert echter al snel in een drama.



